import React from 'react';
import App from './App';
import { createRoot } from 'react-dom/client';

const root = document.getElementById('root');

const express = require('express');
const cors = require('cors');

const app = express();

app.use(cors()); // Permite CORS pentru toate originile

// Restul configurărilor serverului

app.listen(8080, () => {
    console.log('Serverul ascultă pe portul 8080');
});
createRoot(root).render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
